Template.contratos.helpers({
    clientName: function(){
        return Session.get('nombreCliente')
    },

    clientEmail: function(){
        return Session.get('emailCliente')
    }
});

Template.contratos.onRendered(function(){
    console.log("here");
    console.log(Session.get("currentCar"));

    if(Session.get("currentCar")){
        var myCar = Session.get("currentCar");
        console.log("existe");

        console.log(myCar.matricula);

        $('#matricula').val(myCar.matricula);
        $('#marca').val(myCar.nombreCoche);
        $('#bastidor').val(myCar.bastidor);
        $('#damages').val(myCar.damages);
    }

    if(Session.get("currentBooking")){
        var myBooking = Session.get("currentBooking");

        $('#nombre-1').val(myBooking.nombre);
        $('#telf-1').val(myBooking.telefonoCliente);
        $('#email-1').val(myBooking.emailCliente);

        //Coger información de contrato
        $('#salida').val(myBooking.recogida);
        $('#fsalida').val(moment(myBooking.fechareco).format("DD/MM/YYYY"));
        $('#hsalida').val(moment(myBooking.fechareco).format("HH:mm"));

        $('#devolucion').val(myBooking.devolucion);
        $('#fdevolucion').val(moment(myBooking.fechadevo).format("DD/MM/YYYY"));
        $('#hdevolucion').val(moment(myBooking.fechadevo).format("HH:mm"));

        $('#dias').val(myBooking.dias);

        //Coger información de pagos
        $('#precio').val(myBooking.euroscarflet);
        $('#prepago').val(myBooking.qtyPrepago);

        $('#poliza').val("AXA");

        Session.set("nombreCliente", myBooking.nombre);
        Session.set("emailCliente", myBooking.emailCliente);

    }


});



Template.contratos.events({

    "click #sendPDFtrigger": function(e){
        $('#sendContractMailModal').modal('show');
    },

    "change #nombre-1": function(e){
        Session.set('nombreCliente', $('#nombre-1').val());
    },

    
    "change #email-1": function(e){
        Session.set('emailCliente', $('#email-1').val());
    },

    "click #confirmSendContract": function(e){
        var thePDF = createPDF();
        var nombre = Session.get("nombreCliente");
        var email = Session.get("emailCliente");
        var data;
        $("#confirmSendContract").addClass("hide");
        $(".loader").removeClass("hide");
        thePDF.getBase64(function(encodedString) {
            data = encodedString;
            Meteor.call("sendPDFEmail", data, nombre, email, function(error, result){
                if(error){
                    console.log("hubo un error al mandar el mail");
                    $('#sendContractMailModal').modal('hide');
                    FlashMessages.sendError("No se pudo enviar el mail a "+Session.get('nombreCliente')+"("+Session.get('emailCliente')+")", { autoHide: true, hideDelay: 3000 });
                    $("#confirmSendContract").removeClass("hide");
                    $(".loader").addClass("hide");
                } else {
                    $('#sendContractMailModal').modal('hide');
                    $("#confirmSendContract").removeClass("hide");
                    $(".loader").addClass("hide");
                    FlashMessages.sendSuccess("Email Enviado a "+Session.get('nombreCliente')+"("+Session.get('emailCliente')+")", { autoHide: true, hideDelay: 3000 });
                }
            });
        });
    },


  "submit form": function(event){
    event.preventDefault();
    console.log('enviado'); 

    var thePDF = createPDF();
    thePDF.download("Contrato en Carflet "+$("#nombre-1").val()+"");
  },

  'click .check-conductor': function(event){
    console.log('conductor');
    var contConductor2 = $('#datos-conductor-2');
      if($("#segundoconductor").is(':checked')){
          contConductor2.removeClass('sin-conductor');
      }
      else{
          contConductor2.addClass('sin-conductor');
      }
  }
})


